let play = ['r','p','s']
let a = document.getElementById('rock')

let rv =play[Math.floor(Math.random()*play.length)] 
function rock()
{
    document.getElementById('p1').style.backgroundImage = "url(data:image/png;base64,)"
    if (rv == "r")
    { 
        document.getElementById('com').style.backgroundImage = "url(data:image/png;base64,)"
        document.getElementById('result').innerHTML = "game Drawn"
        document.getElementById('retry').style.display = "flex"
        document.getElementById('show').style.display = "block"
    } 
    else if(rv == "p")
    {
        document.getElementById('com').style.backgroundImage = "url(data:image/png;base64,)"
        document.getElementById('result').innerHTML = "Computer Wins"
        document.getElementById('retry').style.display = "flex"
        document.getElementById('show').style.display = "block"
    }
    else
    {
           document.getElementById('com').style.backgroundImage = "url(data:image/png;base64,)"
           document.getElementById('result').innerHTML = "You Wins"
           document.getElementById('retry').style.display = "flex"
           document.getElementById('show').style.display = "block"
    }
    

}
